  [],\n\t\"revision_timestamp\": \"2016-02-20T15:07:51.368159\",\n\t\"name\": \"it-performance-dashboard-systems-dashboard\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The IT Performance Dashboard a trusted source
  for IT performance information across VA. This is available only on the VA intranet.
  \ The dashboard is a collection of information from Regions, VISNs, Facilities,
  and other VA offices across a range of departments within the Office of Information
  & Technology (OIT)u00efu00bfu00bdfrom Product Development and Information Security
  to Human Resources to Finance. It presents often-complex information in easy-to-understand
  dashboard reports.rnCurrently, you can see performance reports relating to Customer
  Service, Service Level Agreements (SLAs), Systems, Monthly Performance Reports (MPR),
  IT Assets and Debt Score, Human Resources, and Network/Security. There is also a
  Facility CIO Center tab where you can see Quarterly Performance Reviews, an OIT
  Daily Brief tab where you can access OIT Daily Brief Reports, and a Product Delivery
  tab that takes you to the PMAS Dashboard. As the IT Performance Dashboard continues
  to evolve, you will be able to see a broader range of performance information u00efu00bfu00bd
  including custom reports, upon request.rnThis page displays the Systems Dashboard
  within the IT Dashboard:rn- VistA Availability:  This report measures and displays
  the percentage of time the RPC Broker service (CPRS) was available on the data server
  for all the sites located in the data centers. Clicking on any of the lines denoting
  Regions will enable the user to drill down and view the data at the VISN level and
  further at the Server level.rnu00efu00bfu00bdtBlue Button Users - First-Time and
  Returning Users:  This report displays the First-Time Users and Returning Users
  that have accessed the Blue Button service for My HealtheVet. A new user is one
  that has never used the Blue Button to perform an activity before, while a returning
  user is one that has used the Blue Button on a previous occasion to perform any
  activity. Clicking on any of the bars on the chart denoting the Months will enable
  the user to drill down and view the daily level data associated with the users.
  Keep date range selection within 18 months for optimal viewing of the charts.rn-
  Availability of Enterprise Hosted Systems:  These reports displays the percentage
  of total monthly availability for ADR, ACS, BDN, CH33, HDR, MPI, MHV, VETSNET, VVA,
  and VIE.rn- Blue Button Activity:  This report displays Blue Button information
  for the types of data viewed and downloaded by users that have performed those actions,
  in addition to the different types of data downloaded by users - consisting of Blue
  Button, Txt, and PDF. Clicking on any of the bars on the chart denoting the Months
  will enable the user to drill down and view the daily level data associated with
  the activity; or in the case of Downloaded Data, the system will first present a
  breakdown of the downloaded data type, and then the daily level data associated
  with the information. Keep date range selection within 18 months for optimal viewing
  of the charts.rn- VANTS:  The following reports are included:  Number of Audio Conferences,
  Total Number of Minutes, Average Number of Calls, Expand Cost Summary Report  Cost
  Summary Reportrn- PIV:  The following reports are included:  Number of Cards Issued
  , Applications By Stages, % of Cards Issued, Cost Centerrn-National Cemetery Administration
  (NCA):  These reports displays the percentage of total monthly availability for
  AMAS, BOSS, Feith Databases\",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\":
